                                break;
                            case 19:
                                tile.type = (ushort)ModContent.TileType<AncientChunk>(); //Lush Growth
                                tile.wall = (ushort)ModContent.WallType<CavernWallUnsafe>(); //Lush Growth Wall
                                tile.active(true);
                                break;
                        }
                        /*switch (_CrystalCaveshapeWall[y, x]) 
						{
							case 1:
								tile.wall = 1;
								break;
						}*/
                    }
                }

            return true;
        }
    }
